import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
const Home = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    loaduser();
  }, []);

  const loaduser = async () => {
    const res = await axios.get("http://localhost:3000/Stddata");
    console.log(res, "hello world");
    setUsers(res.data);
  };
  const deleteuser = async (id) => {
    await axios.delete(`http://localhost:3000/Stddata/${id}`);
    loaduser();
  };

  const edit = (id) => {
    navigator("/edit/" + id);
  };
  return (
    <div>
      {users.map((dta) => {
        return (
          <>
            <h2>
              {dta.name}
              {dta.age}
              <Link to={`/show/${dta.id}`}>Show</Link>
              <Link to={`/edit/${dta.id}`}>Edit</Link>
              <button onClick={() => edit(dta.id)}>Edit</button>
              <Link onClick={() => deleteuser(dta.id)}>Delete</Link>
            </h2>
          </>
        );
      })}
    </div>
  );
};
export default Home;
